INSERT INTO `bidong`.`seller review` (`Seller Article ID`, `Rating`, `Detail`) VALUES ('000000000000004', '5', 'Wonderful packaging. Delivery was notably speedy. Item is of superior quality. Exceptionally speedy dispatch.');
INSERT INTO `bidong`.`seller review` (`Seller Article ID`, `Rating`, `Detail`) VALUES ('000000000000005', '5', 'Excellent packaging. Item was of the most fantastic quality. Quick delivery.');
INSERT INTO `bidong`.`seller review` (`Seller Article ID`, `Rating`, `Detail`) VALUES ('000000000000006', '4', 'The item was outstanding. Swift to send. Packaging was good.');
