INSERT INTO `bidong`.`item review` (`Item Article ID`,`Rating`,`Detail`) VALUES (000000000000001,5,'These are comfortable, breathable, and stay on until you want them to come off. I use these in all my first aid kits and am very pleased.');
INSERT INTO `bidong`.`item review` (`Item Article ID`,`Rating`,`Detail`) VALUES (000000000000002,4,'This is a very good bandage that stays on no matter what! In fact it is so hard to take off and leaves a sticky residue.');
INSERT INTO `bidong`.`item review` (`Item Article ID`,`Rating`,`Detail`) VALUES (000000000000003,4,'Works well on cats who will tolerate being given a bath. Unlike dogs, most cats hate water and think they are being tortured if you try to bathe them. Hopefully you are lucky in that regard.');
INSERT INTO `bidong`.`item review` (`Item Article ID`,`Rating`,`Detail`) VALUES (000000000000004,5,'You don\'t know how really happy I am about this product! I just used this roller on my other bed for less than 2 minutes and look how well it worked!! You don\'t even need to press, just move it gently and it will do its work!! REALLY recommended!');
INSERT INTO `bidong`.`item review` (`Item Article ID`,`Rating`,`Detail`) VALUES (000000000000005,5,'I haven’t noticed any problems of any kind. It’s nicely made and even though some don’t like the foot pedal, I think it’s my favorite part of the entire kit. ');
INSERT INTO `bidong`.`item review` (`Item Article ID`,`Rating`,`Detail`) VALUES (000000000000006,3,'The performance of the litter is great, but the scent became pretty intolerable for me.');
INSERT INTO `bidong`.`item review` (`Item Article ID`,`Rating`,`Detail`) VALUES (000000000000007,5,'As an intermediate pianist, I wanted a piano with a variety of voices for music production purposes, a headphone/sustain pedal port, and realistic piano sound. This nailed all of the above.');
INSERT INTO `bidong`.`item review` (`Item Article ID`,`Rating`,`Detail`) VALUES (000000000000008,5,'I love it!!');
